    render() {
        return (
            <ul classN="list-group my-5">
            <h3 className="text-capitalize text-center">
                todo list 
            </h3>
            <Todoitem/>
            <button type="submit" className="btn btn-danger btn-block text-capitalize mt-5">clear list
            </button>
        </ul>

        )
    }
}
